INSERT INTO `t2_faq_tbl` (`F_NO`, `F_TITLE`, `F_CONTENT`, `U_ID`, `F_HITS`, `CATEGORY_NO`, `F_WRITE_TIME`, `F_UPDATE_TIME`) VALUES
	(1129, '[숙박]  호텔 예약을 했는데 바우처가 없어도 입실이 가능한가요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=3#none" target="_blank" style="color: rgb(61, 61, 61);">[바우처] 호텔 예약을 했는데 바우처가 없어도 입실이 가능한가요?</a></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">호텔예약의 경우 별도의 바우처가 없습니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">예약 확정이 되면 예약번호나 고객님 성함으로 예약이 되어지므로 입실시 예약번호 또는 성함 말씀하시면 입실 가능합니다</span></p><p><br></p><p><br></p>', 'admin', 2, 0, '2023-08-28', '2023-08-28'),
	(1130, '[숙박]  입실 / 퇴실 방법은 어떻게 되나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=3#none" target="_blank" style="color: rgb(61, 61, 61);">[입실 절차] 입실 방법은 어떻게 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);">해당 숙소에 도착하시면 프런트로 가셔서 간단히 등록카드를 작성하신 후 객실 키를 받으셔서 입실하시면 됩니다</span></p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=3#none" target="_blank" style="color: rgb(61, 61, 61);">[퇴실 절차] 퇴실 절차는 어떻게 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>퇴실 전에는 해당 숙소 프런트에 전화를 하셔서 퇴실하시겠다고 말씀하시면 됩니다 간단한 객실 정리를 하시고,물품을 관리하는 직원이 와서 물품 점검을 합니다 직원과 함께 객실 점검을 받으신 후 프런트로 가셔서 객실키를 반납하시면 됩니다</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1131, '[숙박]  취사가 가능한가요?!', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=3#none" target="_blank" style="color: rgb(61, 61, 61);">[취사가능여부] 취사가 가능한가요?!</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>숙소마다 위치나 전망, 가격이 다르듯이 취사도 마찬가지입니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">펜션의 경우 콘도형으로 이루어진 객실이 많기 때문에 대부분은 취사가 가능하나 작은 평수나 허니문을 위한</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">일부의 펜션은 취사도구가 없는 호텔형으로 되어있기도 합니다.</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">펜션에 취사도구가 없다는건 특이사항이기 때문에 예약시 상담원에게 확인 하실수 있으며, 호텔은 취사가</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">불가능하니, 자세한 부분은 상담원과 확인 후 진행 하시면 됩니다.</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1132, '[숙박]  퇴실 시간은 연장가능한가요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=3#none" target="_blank" style="color: rgb(61, 61, 61);">[퇴실시간 연장] 퇴실 시간은 연장가능한가요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);">퇴실시간연장은 해당숙소의 예약상황에 따라 가능여부를 확인 하실 수 있습니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">입실 전에 전화로 퇴실시간 연장은 이루어지지 않고 현장에서 당일 날만 확인이 가능합니다. 만약 객실이 만실 상태라면 연장이 이루어지지 않을 수 있습니다</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1133, '[숙박]   카드 결제 취소를 했는데 내역은 어디서 확인을 하면 되나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=2#none" target="_blank" style="color: rgb(61, 61, 61);">[카드결제 취소내역확인] 카드 결제 취소를 했는데 내역은 어디서 확인을 하면 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>카드결제 후 취소시에는 바로 담당자가 해당카드사에 승인 취소 요청을 합니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">기간은 3 ~ 7일이 소요되며 취소내역은 해당 카드사 홈페이지에서 확인 가능합니다</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1134, '[숙박]  예약취소를 했는데 결제 취소는 어떻게 되나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=2#none" target="_blank" style="color: rgb(61, 61, 61);">[결제취소] 예약취소를 했는데 결제 취소는 어떻게 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>카드로 결제 한 경우에는 승인취소가 되어지며, 통장입금 경우에는 입금자 명의로 된 계좌 번호 확인 후 환불처리 됩니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">환불 소요기간은 3~7일정도 소요 됩니다</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1135, '[숙박]  취소하고 싶은데 환불규정은 어떻게 되나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=2#none" target="_blank" style="color: rgb(61, 61, 61);">[환불 . 취소수수료] 취소하고 싶은데 환불규정은 어떻게 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);">숙박 환불규정</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※조/석식 등 "사전예약상품" 모두 객실 취소수수료와 동일한 취소수수료가 적용됩니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※주말(토,일) 및 공휴일은 퇴근 후 시간은 담당근무자의 부재로 예약 취소가 불가합니다 (변경 및 취소전 반드시 확인 바랍니다)</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※ 기간에 따라 다른 환불규정이 적용 됩니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※ 상담원 퇴근 후 / 주말(토,일) / 법정공휴일 은 담당 근무자의 부재로 예약취소가 불가 합니다.</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">&lt;비수기&gt;</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 10일~9일전 취소 시 : 숙박요금의 10% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 8일~6일전 취소 시 : 숙박요금의 20% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 5일~4일전 취소 시 : 숙박요금의 30% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 3일~2일전 취소 시 : 숙박요금의 50% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 1일전 취소 시 : 숙박요금의 80% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 당일 취소 시 : 전액환불 불가</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">* 연휴기간은 상품에 따라 취소 수수료가 별도 적용될 수 있습니다.</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">&lt;여름성수기 환불규정 | 기간: 7월18일 ~ 8월25일&gt;</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 20일~16일전 취소 시 : 숙박요금의 20% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 15일~11일전 취소 시 : 숙박요금의 30% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 10일~7일전 취소시 : 숙박요금의 50% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 6일~5일전 취소 시 : 숙박요금의 70% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행시작 4일~3일전 취소 시: 숙박요금의 80% 수수료 부과</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 여행당일 2일전~당일 취소시 : 전액환불 불가</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1136, '[숙박]  도착시간이 늦어질것 같은데, 어떻게 하면 될까요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=2#none" target="_blank" style="color: rgb(61, 61, 61);">[늦은시간 체크인] 도착시간이 늦어질것 같은데, 어떻게 하면 될까요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>입실 시간은 각 업체마다 차이가 있지만, 보통 14:00~15:00사이에입실이 가능하며, 22:00 이후 도착시에는 해당 숙소로 미리 통보를 해 주셔야 입실이 가능합니다.</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1137, '[숙박]  결제전인데 예약변경은 어떻게 하나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=2#none" target="_blank" style="color: rgb(61, 61, 61);">[결제전 에약변경] 결제전인데 예약변경은 어떻게 하나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>모든 예약건에 대한 변경요청시에는 상담원과 통화 후 가능합니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">이메일,게시판,온라인상에서는 변경이 되지 않습니다 . 번거롭더라도 상담원과 통화 후 변경 요청드립니다</span></p>', 'admin', 1, 0, '2023-08-28', '2023-08-28'),
	(1138, '[숙박]  주중,주말 구분은 어떻게 되나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=1#none" target="_blank" style="color: rgb(61, 61, 61);">[주중,주말 기준] 주중,주말 구분은 어떻게 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>보통 숙소의 주중이라고 하면 월요일부터 목요일까지를 말하며 주말은 금요일에서 일요일까지를 말합니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">숙소 요금 또한 주중과 주말은 차이가 납니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">허나 숙소가 여러곳인 만큼 모두 똑같이 주중,주말을 적용하지는 않습니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">숙소에 따라 주중,주말 구분없는 곳도 있고 주중/주말 요일 적용이 다른 곳도 있습니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">또한, 비수기, 성수기,연휴 등에 따라서도 금액은 달리 적용 되오니 정확한 금액은 상담원에게 문의하시는게</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">가장 좋을 듯 합니다.</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1139, '[숙박]  결제후 일정을 변경하고 싶은데 어떻게 하면 되나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=7&amp;page=1#none" target="_blank" style="color: rgb(61, 61, 61);">[결제후 예약변경] 결제후 일정을 변경하고 싶은데 어떻게 하면 되나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>카드 결제 후 예약 변경의 경우에는 카드 부분 취소나 승인이 이루어 지지 않으므로 기존 결제 건에 대해 카드 승인 전체 취소가 이루어지며 변경건에 대한 재 결제을 해 주셔야 합니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">무통장 입금의 경우에는 예약변경으로 인한 차액분은 환불 또는 추가입금이 가능합니다</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1140, '[렌트]  차량인수는 어디서, 어떻게 받나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=6#none" target="_blank" style="color: rgb(61, 61, 61);">[렌터카 / 차량인수방법및장소] 차량인수는 어디서, 어떻게 받나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>차량인수는 제주공항 1층 5번게이트 맞은편 렌트카하우스 주차구역 에서 예약하신 렌트카 업체의 셔틀버스 로 이동 후 렌트카 사무실에서 차량인수 받으시면 됩니다</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">또한 렌트카 업체마다 셔틀버스 탑승구역이 상이하오니 예약완료시 발송되는 알림톡 또는 문자내용을 반드시 숙지하여 주시기 바랍니다</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※ 실운전자 운전면허증 필지참</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※ 2016년 9월1일부터, 기존 제주공항 내 렌터카하우스(렌터카 주차장)가 폐쇄됨에 따라 렌터카 배정 협력사별 셔틀버스 탑승 후, 본사(차고지)로 이동하시어 차량 인수가 가능합니다.</span></p>', 'admin', 0, 0, '2023-08-28', '2023-08-28'),
	(1141, '[렌트]  면허증 분실시 어떻게 해야 하나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=6#none" target="_blank" style="color: rgb(61, 61, 61);">[렌터카 / 면허증분실] 면허증 분실시 어떻게 해야 하나요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>렌트카 인수및 이용시 운전면허증은 필수로 소지하고 계셔야 합니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">부득이하게 운전면허증을 분실했을 경우 가까운 경찰서에서 이용용도 확인후 경력증명서 또는 임시면허증을 발급받고 신분증과 함께 준비해 오시면 됩니다.</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">운전경력증명서는 온라인으로 \'민원24\' 사이트에서도 발급이 가능합니다.</span></p>', 'admin', 1, 0, '2023-08-28', '2023-08-28'),
	(1142, '[렌트]  아침 일찍 오전 6시경에 차량을 인수할 수 있나요??', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=6#none" target="_blank" style="color: rgb(61, 61, 61);">[렌터카 / 차량인수시간] 아침 일찍 오전 6시경에 차량을 인수할 수 있나요??</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>공항에서 렌터카 인수, 반납은 첫 비행기 도착시간부터 마지막비행기 출발시간이</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">기준이되며 일반적으로 8:00~21:00까지 운영되고 있습니다.</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">하지만, 현지 사정에 의해 변경될 수도 있으니 예약시 꼭 확인바랍니다.</span></p>', 'admin', 1, 0, '2023-08-28', '2023-08-28'),
	(1143, '[렌트]  대여조건에 만21세이상,운전경력은 승용차 1년이상, 승합차는 2년이상이라고 되어있는데 운전경력이나 나이가 기준에 조금 못 미치는데 이용이 안될까요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=6#none" target="_blank" style="color: rgb(61, 61, 61);">[렌터카/연령기준] 대여조건에 만21세이상,운전경력은 승용차 1년이상, 승합차는 2년이상이라고 되어있는데 운전경력이나 나이가 기준에 조금 못 미치는데 이용이 안될까요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>렌트카에 가입되어있는 자동차보험(대인,대물,자손)의 연령제한 , 운전미숙으로 인한 사고방지를 위해 렌트카 대여조건에 맞지 않을경우 이용이 불가합니다</span></p>', 'admin', 3, 0, '2023-08-28', '2023-08-28'),
	(1144, '[렌트]  차량 렌트를 하려면 어떤 조건이 있어야 하나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=6#none" target="_blank" style="color: rgb(61, 61, 61);">[렌터카 / 이용조건] 차량 렌트를 하려면 어떤 조건이 있어야 하나요?</a></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">렌트카의 대여조건은 다음과 같습니다</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">승용차량: 나이 만21세 이상, 면허취득일 1년이상</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">승합차량: 나이 만26세 이상, 면허취득일 2년이상</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">특수차량: 나이 만30세 이상, 면허취득일 3년이상</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 9인승 이하 차종 이용시 2종보통면허</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 11인승 이상의 승합차종 이용시 1종 보통면허</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">- 특수차량(쏠라티) 이용시 대형면허</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">(※ 렌트카 업체마다 대여조건이 다를수 있으니 예약시 확인 후 이용바랍니다) 외국인인 경우 국제운전면허증과 여권이 반드시 필요합니다</span></p>', 'admin', 2, 0, '2023-08-28', '2023-08-28'),
	(1145, '[렌트]  불포함내역에 자차보험이 있는데 자차보험이 무엇이고, 요금이 얼마인가요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p><a href="https://www.jeju.com/help/faq/faq_list.html?agt=jeju&amp;typenum=6#none" target="_blank" style="color: rgb(61, 61, 61);">[렌터카 / 보험] 불포함내역에 자차보험이 있는데 자차보험이 무엇이고, 요금이 얼마인가요?</a></p><p><br></p><p><span style="color: rgb(61, 61, 61); background-color: rgb(250, 250, 250);"><span class="ql-cursor">﻿</span>자차보험이란 자기차량손해담보를 줄여서 말하는것으로 사고가 날 경우 렌트카 수리비용에 대하여 보험처리가 가능합니다. (자차보험 미가입후 사고시 렌트카 수리비용전액 및 휴차보상료 청구)</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">자차보험은 \'일반자차\'와 \'완전자차\'로 선택이 가능합니다</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">-일반자차: 렌트카 사고시 \'자기부담금(면책금)과 휴차보상료\'를 제외한 일부보험처리 (보험 보상한도 내)</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※자기부담금(면책금)과 휴차보상료는 이용자에게 별도 청구</span></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">-완전자차: 렌트카 사고시 렌트카수리비 전액 보험처리 (보험 보상한도 내)</span></p><p><br></p><p><span style="background-color: rgb(250, 250, 250); color: rgb(61, 61, 61);">※자차보험 가입조건은 렌트카 업체마다 다를 수 있으며 보상한도 또한 업체마다 다를수 있습니다.</span></p>', 'admin', 6, 0, '2023-08-28', '2023-08-28'),
	(1146, '[기타문의]  여행가방은 어떻게 꾸려야 할까요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p>[기타문의] <span style="color: rgb(85, 85, 85);">여행가방은 어떻게 꾸려야 할까요?</span></p><p><br></p><p><span style="color: rgb(102, 102, 102); background-color: rgb(251, 251, 251);"><span class="ql-cursor">﻿</span>가방은 간편할수록 좋습니다.(보통 큰 가방, 작은 가방, 복대)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">큰 가방에는 의류(여행국의 날씨를 참고하여 준비하시고, 더운 나라라도 밤낮의 기온차, 차안, 식당 등은 에어컨 시설 때문에 추위를 느낄 수 있으므로 긴 팔 하나 정도 준비하시면 좋습니다) 수영복(여행국가에 따라서)/신발(가장 편한 신발, 샌들), 우산/세면도구(치약, 칫솔이 없는 호텔이 있습니다)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">구급약(외국의 경우 의사의 처방전 없이 약을 살수 없으므로 지사제/해열제, 물파스, 감기약, 소화제, 항생연고 정도 준비하면 좋습니다)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">작은 가방에는 여행 중에 꼭 필요한 물품을 넣어 들고 다닐 정도면 좋겠습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">여행정보(안내서, 여행 일정표, 읽을거리 등)/선크림, 선그라스, 모자, 카메라, 필름 등 / 여권사본, 사진 2매(여권 분실에 대비 여권과 따로 보관)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">복대에는 여권, 항공권, 현금 등</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">항공사마다 개인별 수하물을 제한하고 있는 데, 보통 1인당 25㎏～30㎏ 정도로, 초과분에 대해서는 추가요금을 부담해야 합니다.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">기내에 들고 탈수 있는 가방은 가로세로 높이의 합이 158㎝(62인치) 입니다.</span></p>', 'admin', 3, 0, '2023-08-28', '2023-08-28'),
	(1147, '[기타문의]  여행시 주의해야 할 점은 어떤 것이 있나요 ?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p>[기타문의] <span style="color: rgb(85, 85, 85);">여행시 주의해야 할 점은 어떤 것이 있나요 ?</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 비상사태를 위해 현지 공관의 연락처 및 비상연락처를 알아둡니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 고가의 장신구(시계, 목걸이, 반지 등) 착용을 삼가는 게 좋습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 여행국에 대한 여행정보 및 유의사항을 사전에 알아둡니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 입국심사를 받을 때 성실, 정직하게 답변해야 합니다.(입국사증면제거나 입국사증(비자)을 받았더라도 입국이 거절당할 수 있습니다)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 여권과 현금 그리고 귀중품은 호텔의 금고 등에 보관하는 게 안전합니다.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 전세계 어느 관광지든지 여행객의 여권이나 금품을 노리는 강도,소매치기가 있으니 주의하시기 바랍니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 혼자서 외출을 삼가고 낯선 사람의 과도한 친절과 호의를 경계합니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 외출시에는 호텔 명함을 지참하거나 현지 가이드나 여행사의 연락처를 알아둡니다.</span></p>', 'admin', 2, 0, '2023-08-28', '2023-08-28'),
	(1148, '[기타문의]  여행시 여권을 잃어버리면 어떻게 해야하나요 ?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p>[기타문의] <span style="color: rgb(85, 85, 85);">여행시 여권을 잃어버리면 어떻게 해야하나요 ?</span></p><p><br></p><p><span style="color: rgb(102, 102, 102); background-color: rgb(251, 251, 251);"><span class="ql-cursor">﻿</span>- 현지 경찰서에 신고하고 분실증명확인서(POLICE REPORT)를 받습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 재외공관에 본인이 직접 분실신고를 하고, 임시여권이나 여행증명서를 발급 받습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 일정이 여러 국가를 여행한다면 여권을 재발급 받아야 하지만, 다음 일정이 없고 귀국해야 한다면 발급 기일이 짧은 여행증명서를 발급 받고 귀국해서 여권 재발급을 신청하는 것이 좋습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">(재외공관에서 재발급 소요시간 : 여권 1주～2주, 여행증명서 3～4일)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 여행시 여권을 재발급 받을 때 분실여권의 사본과 여권용사진 2장 있으면 발급기일이 단축될 수있습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">- 5년 내에 3회 이상 여권을 분실할 경우 법에 따라 조사를 받게됩니다.</span></p><p><br></p>', 'admin', 2, 0, '2023-08-28', '2023-08-28'),
	(1149, '[기타문의]  도둑 맞았을 때는 어떻게 대처 해야하나요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p>[기타문의] <span style="color: rgb(85, 85, 85);">도둑 맞았을 때는 어떻게 대처 해야하나요?</span></p><p><br></p><p><span style="color: rgb(102, 102, 102); background-color: rgb(251, 251, 251);"><span class="ql-cursor">﻿</span>1)절도를 당한 즉시 가장 가까운 경찰서로 가서 반드시 POLICE REPORT를 받습니다. 이때 신고는 본인이 직접 작성해야 하며 절도를 당한 여행객 인원수대로 별도작성해야 손해를 줄일 가능성이 더 있습니다.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">2)본국으로 귀국후 POLICE REPORT를 가지고 보험회사에 신고합니다.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">보험사 제출시 필요서류 : POLICE REPORT, 손상품 수리견적서(영수증 포함),여권사본, 통장사본 (본인의 통장이 아닐 경우 관계를 나타낼 수 있는 서류)</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">보험처리가 안되는 것들 : 현금, 수표, 항공권 등등의 유가증권</span></p><p><br></p>', 'admin', 5, 0, '2023-08-28', '2023-08-28'),
	(1150, '[기타문의]  자유여행을 가려하는데요. 조언 좀 해주세요.', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p>[기타문의] <span style="color: rgb(85, 85, 85);">자유여행을 가려하는데요. 조언 좀 해주세요.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">여행을 떠나기전에 해당국의 지도를 펴놓고 관광지와 여행기간과 경비를 고려해서 대략적인 코스를 정해보세요.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">항공권은 항공사로 직접하시는 것보다 여행사에서 판매하는 할인항공권이나 그룹항공권을 알아보시면 보다 저렴하게 가시는 방법이 있습니다.</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">현지에서의 생활은 나라마다 조금씩 차이는 있지만 저렴하게 하시려면 슈퍼나 패스트 푸드점을 이용하시고, 꼭 호텔이 아니더라도 민박, 유스호스텔등 을 이용하시면 됩니다.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">자세한 사항은 일단 시중에 많이 나와있는 책자나 인터넷을 통한 경험담을 통해 자료를 구하시고,</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">물론 여행코스는 현지에 가서 생활하다보면 바뀌게 되는 경우가 많습니다.</span></p><p><br></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">숙박은 현지에서 구하는 것이 더 저렴할 수 도 있고, 호텔을 이용하는 경우는 저렴한 할인 호텔가격으로 판매하는 여행사를 통하는것이 더 좋은 방법일 수 도 있습니다.</span></p>', 'admin', 20, 0, '2023-08-28', '2023-08-28'),
	(1151, '[패키지]  패키지여행이란 무엇인가요?', '<p>안녕하세요.</p><p><br></p><p>조조 투어를 이용해주셔서 감사드립니다.</p><p><br></p><p>[패키지] <span style="color: rgb(85, 85, 85);">패키지여행이란 무엇인가요?</span></p><p><br></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">여행사에서 미리 세팅해 놓은 항공권, 관광일정, 숙박, 식사, 교통 등을 이용하여 여행하 는 것을 패키지 여행이라고 합니다.</span></p><p><span style="background-color: rgb(251, 251, 251); color: rgb(102, 102, 102);">보통 10명~15명이 한 팀이 되어 단체로 관광을 하기 때문에 개인적으로 가시는 여행보다 저렴하게 여행하실 수 있습니다!</span></p>', 'admin', 86, 0, '2023-08-28', '2023-08-30');
INSERT INTO `t2_free_tbl` (`FREE_NO`, `FREE_TITLE`, `FREE_CONTENT`, `U_ID`, `F_HITS`, `F_WRITE_TIME`, `F_UPDATE_TIME`, `RECOMMEND`, `DELYN`, `NOTIFY_CNT`) VALUES
	(17, '조조투어 쿠폰 나눔합니다.', '<p>댓글 주시면 연락드릴께요.</p>', 'eksqjf', 7, '2023-08-28', '2023-08-28', 0, 'N', 0),
	(18, '기분좋네요 ㅎ', '<p>지난주에 조조투어에서 예약해서 제주도 갔다왔는데 너무 행복했습니다. 다음번에도 또 이용할 계획이예요 ㅎ_ㅎ</p>', 'whwhxndj', 11, '2023-08-28', '2023-08-28', 0, 'N', 0),
	(19, '김포에서 놀기 좋은 현대프리미어아울렛!', '<p>엊그제 쇼핑갔다왔는데 플렉스 하고 왔네요. 훗</p>', 'rlavh', 7, '2023-08-28', '2023-08-28', 0, 'N', 0),
	(20, '요즘 재밋는게임 없나요?', '<p>주말마다 심심해 죽겠어요~~~</p>', 'rlavh', 7, '2023-08-28', '2023-08-28', 0, 'N', 0),
	(21, '아 기분이 별로네요.', '<p>저번주에 놀러갔다왔는데 사장 마인드가,...ㅡㅡ 어느 숙박업체인지는 공개 안하겠지만 정말 별로였어요 </p>', 'dltmdgus', 18, '2023-08-28', '2023-08-28', 0, 'N', 0),
	(22, '오늘 야구는 누가이길까요 ?', '<p>ssg랑 키움이랑하는데 누가이길까요 ?</p><p>개인적으로는 ssg가이기는게 ..</p>', 'qkqh', 1, '2023-08-29', '2023-08-29', 0, 'N', 0),
	(23, '혼자여행하기좋은곳 추천해주시면 감사하겠습니다!', '<p>제곧내</p>', 'qkqh', 6, '2023-08-29', '2023-08-29', 3, 'N', 0),
	(24, '여행관련조언부탁드립니다', '<p>여행할때 커피는 몇잔정도 마셔야되나요?</p><p>아시는분있으면 조언좀 부탁드립니다 ㅠㅠ</p>', 'qkqh', 1, '2023-08-29', '2023-08-29', 0, 'N', 0),
	(25, '숙소에 컴퓨터', '<p>숙소에 컴퓨터들고가서 게임할수있을까요?</p><p>해보신분있으시면 댓글달아주세요!</p>', 'qkqh', 0, '2023-08-29', '2023-08-29', 0, 'N', 0),
	(26, '배낭여행가기좋은곳 추천해주세요!', '<p>배낭여행가려고하는데 로컬맛집많은곳 추천해주세요~</p>', 'yerim', 1, '2023-08-29', '2023-08-29', 0, 'N', 0),
	(27, '같이 여행가실분구합니다!', '<p>배낭여행 같이가실분 있으실까요?</p><p>개인적으로 dm부탁드립니다.</p><p>010-2242-7850</p>', 'yerim', 0, '2023-08-29', '2023-08-29', 0, 'N', 0),
	(29, '9월1일 ssg vs kia 경기 보러가시는분있나요?', '<p>기아팬들 지고서 화풀이하는거아닌가모르겠네요 ㅠㅠ&nbsp;</p><p>무서워요</p>', 'qkqh', 40, '2023-08-29', '2023-08-29', 0, 'N', 0),
