INSERT INTO `t2_notice_tbl` (`N_NO`, `N_TITLE`, `N_CONTENT`, `U_ID`, `N_HITS`, `N_KIND_NO`, `F_WRITE_TIME`, `F_UPDATE_TIME`) VALUES
	(200016, '조조투어 서비스 이용약관 개정고지', '<p>안녕하세요.&nbsp;조조투어입니다.&nbsp;</p><p>&nbsp;</p><p>저희 조조투어를 이용해 주시는 고객님께 감사 드리며,</p><p>㈜조조투어에 신규서비스가 추가 됨에 따라</p><p>서비스 이용약관이 다음과 같이 최신화 되어 안내 드립니다.&nbsp;</p>', 'admin', 3, 0, '2023-08-28', '2023-08-28'),
	(200017, '개인정보 처리방침 변경 안내', '<p>안녕하세요. ㈜조조투어 입니다.</p><p>항상 저희 조조투어를 이용해 주시는 고객님께 깊은 감사를 드립니다.</p><p>개인정보 활용 변경으로 인한 개인정보 처리방침이 다음과 같이 변경되어 안내드립니다.</p><p>* 변경 적용일인 2023년 8월 13일 전까지 별도 의사표시가 없으신 분은 개인정보 처리방침의 변경사항 적용에 동의하신 것으로 간주됩니다.</p><p>* 개정된 개인정보 처리방침에 동의하지 않으시는 경우, 회원탈퇴를 요청하실 수 있습니다.</p>', 'admin', 5, 0, '2023-08-28', '2023-08-28'),
	(200018, '예약/결제 장애 안내 _ 정상 복구 완료', '<p>안녕하세요. 조조투어 항공입니다.</p><p>&nbsp;</p><p><strong style="color: rgb(255, 0, 0);">조조투어 일부 시스템 장애가 복구되어 정상 이용 가능합니다.</strong></p><p>&nbsp;</p><p>보다 나은 서비스 환경을 구축하기 위하여 최선의 노력을 다하겠습니다.</p><p>감사합니다.</p><p>&nbsp;</p>', 'admin', 8, 0, '2023-08-28', '2023-08-28'),
	(200019, '시스템 점검에 따른 이용제한 안내', '<p>안녕하세요. 조조투어입니다.</p><p><br></p><p>언제나 조조투어를 사랑해주시는 고객님께 진심으로 감사드립니다.</p><p><br></p><p>보다 새롭고 안정적인 서비스 제공을 위해 조조투어 서비스가</p><p>아래 시간동안 일시중단 되오니 이용에 참고 부탁드립니다.&nbsp;</p>', 'admin', 8, 0, '2023-08-28', '2023-08-28'),
	(200020, '상담 지연 안내', '<p>안녕하세요.&nbsp;조조투어&nbsp;입니다.</p><p><br></p><p>&nbsp;현재 여행&nbsp;관련&nbsp;문의가&nbsp;폭주하고&nbsp;있어 전화연결이 어려운점 고객님들의 양해를 구합니다.&nbsp;</p><p><br></p><p>&nbsp;예약하신&nbsp;고객님께서는&nbsp;자주&nbsp;문의하시는&nbsp;질문에&nbsp;대한&nbsp;답변은&nbsp;<strong style="color: rgb(240, 44, 140);">[FAQ 게시판]</strong>&nbsp;참고&nbsp;부탁드리며,</p><p>&nbsp;그&nbsp;외&nbsp;문의는&nbsp;마이페이지&nbsp;내&nbsp;예약&nbsp;정보에<strong style="color: rgb(240, 44, 140);">&nbsp;[1:1&nbsp;문의]</strong>&nbsp;접수&nbsp;부탁드립니다.</p><p><br></p><p>&nbsp;최선을&nbsp;다해&nbsp;응대하여&nbsp;드리겠습니다.&nbsp;</p><p>&nbsp;감사합니다.</p>', 'admin', 31, 0, '2023-08-28', '2023-08-28'),
	(200022, '조조투어Web IE 브라우저 지원 종료 안내', '<p>안녕하세요,조조투어입니다.</p><p>조조투어Web 페이지에 대한 IE 브라우저 지원을 2023년 8월 29일부터 종료하게 되어 안내 드립니다.</p><p>조조투어Web은 크롬 또는 엣지 브라우저를 통해 안전하게 조조투어를 계속 이용하실 수 있습니다.</p><p>IE 브라우저를 사용하시는 고객님께 죄송하다는 말씀드리며, 항상 조조투어를 이용해주셔서 감사드립니다.</p>', 'admin', 0, 0, '2023-08-29', '2023-08-29'),
	(200023, ' 조조투어 차이(CHAI) 간편 결제 수단 서비스 제공 종료', '<p><span style="color: rgb(23, 43, 77);">안녕하세요. </span>&nbsp;조조투어<span style="color: rgb(23, 43, 77);">입니다.&nbsp;</span></p><p><span style="color: rgb(23, 43, 77);">&nbsp;</span></p><p>&nbsp;조조투어를<span style="color: rgb(23, 43, 77);"> 이용해 주시는 고객님께 감사의 말씀을 드립니다.&nbsp;</span></p><p>&nbsp;조조투어<span style="color: rgb(23, 43, 77);">에서 차이(CHAI) 간편 결제 수단 서비스 제공이 종료될 예정입니다.&nbsp;</span></p><p><span style="color: rgb(23, 43, 77);">&nbsp;</span></p><p><strong style="color: rgb(23, 43, 77); background-color: rgb(255, 255, 255);">종료 일시 : 2023-08-29 (월)&nbsp;</strong></p><p><strong style="color: rgb(23, 43, 77); background-color: rgb(255, 255, 255);">종료 내용 : </strong>&nbsp;<strong>조조투어</strong><strong style="color: rgb(23, 43, 77); background-color: rgb(255, 255, 255);">에서 차이(CHAI) 간편 결제 수단으로 결제 불가&nbsp;</strong></p><p><span style="color: rgb(23, 43, 77);">&nbsp;</span></p><p><span style="color: rgb(23, 43, 77);">결제 수단 서비스 제공 종료에 대한 양해 부탁 드리며,</span></p><p><span style="color: rgb(23, 43, 77);">더욱 편리한 서비스와 다양한 혜택을 제공할 수 있도록 최선을 다하겠습니다.&nbsp;</span></p><p><br></p><p><span style="color: rgb(23, 43, 77); background-color: rgb(255, 255, 255);">감사합니다.&nbsp;</span></p><p><br></p>', 'admin', 1, 0, '2023-08-29', '2023-08-29'),
	(200024, '자주 묻는 질문 FAQ 개편 안내', '<p><span style="background-color: rgba(255, 255, 255, 0.1); color: rgb(97, 97, 97);">안녕하세요. 조조투어입니다.</span></p><p><br></p><p><strong style="color: rgb(97, 97, 97); background-color: rgba(255, 255, 255, 0.1);">&lt;자주 묻는 질문 FAQ&gt; </strong><span style="color: rgb(97, 97, 97); background-color: rgba(255, 255, 255, 0.1);">이 개편되어 공지 드립니다.</span></p><p><br></p><p>자주 묻는 질문 FAQ를 통해 궁금하신 사항을 빠르게 해결할 수 있습니다.&nbsp;&nbsp;</p><ul><li><strong>변경 일자 : </strong>2022년 12월 19일&nbsp;</li><li><strong>변경 내용 : </strong>자주 묻는 질문 카테고리 개편&nbsp;</li><li><strong>경로 :</strong> 게시판 &gt; FAQ</li></ul><p><br></p><p><span style="background-color: rgba(255, 255, 255, 0.1); color: rgb(97, 97, 97);">조조투어</span>는 보다 나은 서비스를 제공하기 위해 최선을 다 하겠습니다.</p><p><br></p><p>감사합니다.</p><p><br></p>', 'admin', 0, 0, '2023-08-29', '2023-08-29'),
	(200025, '전자금융거래 이용약관 안내', '<p>안녕하세요, 조조투어입니다.</p><p><br></p><p>2023년 8월 29일자로 조조투어 전자금융 선불 서비스가 신규 런칭함에 따라, 전자금융거래 이용약관이 추가되어 안내드립니다.</p><p><br></p><p>상세 내용은 아래 약관 전문을 통하여 확인 가능하오니 이용에 참고 부탁드립니다.</p><p><br></p><p>- 적용일자: 2023년 8월 29일</p><p>- 전문: 전자금융거래 이용약관 <a href="https://policy.yanolja.com/policy/?t=terms-eft" target="_blank" style="color: blue;">[자세히 보기]</a></p><p><br></p><p>이용약관 동의 후 기존과 동일하게 조조투어 포인트 서비스 이용이 가능하오니, 고객님께서는 새롭게 추가된 이용약관을 확인하시어 이후 서비스 이용에 불편 없으시길 바랍니다.</p><p><br></p><p>감사합니다.</p><p><br></p>', 'admin', 2, 0, '2023-08-29', '2023-08-29'),
	(200026, '조조투어 서비스 정기점검 안내 (08/31 AM 3:00 ~ 07:00)', '<p>안녕하세요. 조조투어입니다.</p><p><br></p><p>더욱 안정적인 서비스 제공을 위한 정기점검을 안내드립니다.&nbsp;</p><p>&nbsp;</p><p><strong>점검일시 안내</strong></p><p>&nbsp;</p><p>▶ 2023년 8월 31일(목) 오전 3:00~7:00 (약 4시간 00분)</p><p>&nbsp;</p><p><strong>점검범위 안내</strong></p><p>&nbsp;</p><p>▶PC웹 조조투어 서비스 전체 사용 불가&nbsp;</p><p>&nbsp;</p><p>서비스 이용에 불편을 드려 죄송합니다.</p><p>&nbsp;</p><p>빠른 점검과 안정된 서비스로 찾아 뵙겠습니다.</p><p>&nbsp;</p><p>감사합니다. ​ ​ ​​&nbsp;</p><p><br></p>', 'admin', 3, 0, '2023-08-29', '2023-08-29'),
	(200027, 'ID 계정 사용 종료 최종 안내', '<p><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">안녕하세요, 조조투어입니다.</span></p><p><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">일반 ID 계정의 사용 가능 기간이 곧 종료됩니다.</span></p><p><br></p><p><strong style="color: rgb(255, 0, 0); background-color: rgb(255, 255, 255);">2023. 9. 1. 14:00</strong><strong style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);"> </strong><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">이후에는 일반 ID 계정의 사용이 불가하오니,</span></p><p><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">일반 ID 계정의 회원들께서는 원활한 서비스 이용을 위하여</span><strong style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);"> </strong><strong style="color: rgb(0, 0, 255); background-color: rgb(255, 255, 255);">2023. 9. 1. 13:59</strong><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);"> 이내에 이메일 계정으로 가입하여 주시기 바랍니다.</span></p><p><br></p><p><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">본 공지와 관련한 문의사항은 </span><span style="color: rgb(46, 46, 46);">조조투어</span><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);"> 고객센터(</span><span style="color: rgb(245, 245, 245); background-color: rgb(43, 45, 46);">032-521-8889</span><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">)로 연락 부탁드립니다.</span></p><p><br></p><p><br></p><p><br></p><p><span style="color: rgb(46, 46, 46); background-color: rgb(255, 255, 255);">감사합니다.</span></p><p><br></p><p><br></p>', 'admin', 4, 0, '2023-08-29', '2023-08-29'),
	(200028, '후기 포인트 적립 정책 변경 안내', '<p>안녕하세요,&nbsp;조조투어&nbsp;입니다.</p><p>조조투어&nbsp;서비스의&nbsp;&lt;후기&nbsp;포인트&gt;&nbsp;정책이&nbsp;아래와&nbsp;같이&nbsp;변경&nbsp;되어 안내&nbsp;드립니다.&nbsp;</p><p>&nbsp;</p><p><strong>변경&nbsp;전</strong></p><p>● 국내&nbsp;숙소&nbsp;카테고리에&nbsp;한하여&nbsp;바른&nbsp;후기&nbsp;작성&nbsp;시,&nbsp;<u>총&nbsp;판매금액의&nbsp;0.5%</u>가&nbsp;‘포인트’ 로&nbsp;적립됩니다.</p><p>&nbsp;</p><p><strong>변경&nbsp;후</strong></p><p>​●&nbsp;국내&nbsp;숙소&nbsp;카테고리에&nbsp;한하여&nbsp;바른&nbsp;후기&nbsp;작성&nbsp;시,&nbsp;<u>총 판매금액의 0.5%</u>에 해당하는 금액만큼 \'야놀자 코인\'(1원=1C)으로 적립됩니다.</p><p><br></p><p>관련&nbsp;사항은&nbsp;고객센터(<span style="background-color: rgb(43, 45, 46); color: rgb(245, 245, 245);">032-521-8889</span>)로&nbsp;문의&nbsp;주시면,&nbsp;친절하게&nbsp;안내&nbsp;드리겠습니다.</p><p>&nbsp;</p><p>항상&nbsp;조조투어&nbsp;서비스에&nbsp;관심을&nbsp;갖고&nbsp;이용해주시는&nbsp;고객님들께&nbsp;진심으로&nbsp;감사드리며,&nbsp;보다&nbsp;나은&nbsp;서비스&nbsp;제공을&nbsp;위해&nbsp;언제나&nbsp;최선을&nbsp;다하는&nbsp;조조투어가&nbsp;되겠습니다.</p><p>&nbsp;</p><p>감사합니다.</p><p><br></p>', 'admin', 18, 0, '2023-08-29', '2023-08-29');
